function getRandomArbitrary(min, max) {
  return parseInt(Math.random() * (max - min) + min);
}
function arrayShuffle(arr = []) {
  return [...arr].sort(() => Math.random() - 0.5);
}
function arraySwap(arr, x, y) {
  const v = arr[x];
  arr[x] = arr[y]; arr[y] = v;
  return arr;
}
function makeid(str = null) {
  let result = '';
  const characters = !str ? 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789' : str;
  // const charactersSplit = characters.match(/.{1}/gu);
  const charactersSplit = [...characters];
  let counter = 0;
  return (length) => {
    while (counter < length) {
      result += charactersSplit[getRandomArbitrary(0, charactersSplit.length - 1)];
      counter += 1;
    }
    return result;
  }
}

